import React from "react";

function Home() {
  return (
    <div className="container-fluid">
      <div className="row">
          <div className="col-md-6 home-col">
            <img src="https://retro-avatar.s3.amazonaws.com/avatar_5c0533500f0dc351421d2c6c50717252.png" height={100} width={100}/>
          </div>
      </div>
    </div>
  );
}

export default Home;
